-- Volcando estructura para función inicioi_seg.fnDevuelveCondicion
DELIMITER //
CREATE FUNCTION `fnDevuelveCondicion`(`Campo` VARCHAR(50),
	`Valor` VARCHAR(50)
) RETURNS varchar(250) CHARSET utf8mb4
BEGIN
DECLARE Condicion VARCHAR(750);
SET Campo= replace(Campo,'''','');
SET Valor= replace(Valor,'''','');
#consultamos un where
	IF(Substring(Valor,1, 1) <>'.')	THEN
		SET Condicion=' WHERE ';
	ELSE
		IF(Substring(Valor,2, 1) =',')	THEN
			SET Condicion=' OR ';
			SET Valor=Substring(Valor,3,LENGTH(Valor));
		
		ELSE
			SET Condicion=' AND ';
			SET Valor=Substring(Valor,2,LENGTH(Valor));
		END IF;
	END IF;
#preguntas
	IF (Substring(Campo,1, 1) = 'C') THEN
      SET Condicion = CONCAT(Condicion, '' , Substring(Campo,2, LENGTH(Campo)) , ' like ','''','%',Valor,'%','''');
   END IF;
   
   IF (Substring(Campo,1, 1) = '(')  THEN
      SET Condicion = CONCAT(Condicion , '(' , Substring(Campo,2, LENGTH(Campo)) , ' like ' , '''' , '%' , Valor , '%' , '''');
   END if;
   
	IF (Substring(Campo,1, 1) = ')')  then
      SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' like ' , '''' , '%' , Valor , '%' , '''',')');
   END if;
   IF (Substring(Campo,1, 1) = 'I')  then
      SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' like ' , '''' , Valor , '%' , '''');
   END IF;
   
   IF (Substring(Campo,1, 1) = 'N') then
		IF(IsNumeric(Valor)=1) then
			  IF(Valor='0') then
				SET Condicion = '';
			  else
				SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' = ' , Valor );
			  END if;
		ELSE
		  SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' = 0' );
		END if;
   END if;
   
    IF (Substring(Campo,1, 1) = 'D')  then
    	IF(STR_TO_DATE((Valor), '%d,%m,%Y') IS NOT NULL) then
			SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' = ' , '''' ,  Valor ,  ''''    );
		else
			SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' = ' , '''' ,  '01/01/1990' ,  '''' );
		END if;   
    END if;
	if (Substring(Campo,1, 1) = 'T')  then
      SET Condicion = ''  ;
   END if;
   
    if (Substring(Campo,1, 1) = 'L')  then
      SET Condicion = CONCAT(Condicion ,  '' ,  Substring(Campo,2, LENGTH(Campo)) , ' = ' , '''' ,  Valor ,  ''''   );
		END if ;         
	if (Substring(Campo,1, 1) = 'P') then
      SET Condicion = CONCAT(Condicion ,   Substring(Campo,2, LENGTH(Campo)) , ' = '  ,  Valor    ); 
		END if;          
    if (Substring(Campo,1, 1) = 'E')  then
      SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' <> ' , '''' ,  Valor ,  ''''    );
		END if;          
	if (Substring(Campo,1, 1) = 'O')  then
      SET Condicion = CONCAT(' order by ' , Substring(Campo,2, LENGTH(Campo)) , ' ' , Valor);
      END if;
    if (Substring(Campo,1, 1) = 'Z')  then
      SET Condicion = CONCAT(Condicion , 'Substring(' , Substring(Campo,2, LENGTH(Campo)) , ',2, LENGTH(' , Substring(Campo,2, LENGTH(Campo)), ')) = ' ,   Valor  ) ;
		END if;           
    if (Substring(Campo,1, 1) = '>')  then
      SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' >= convert(datetime,' , '''' ,  Valor ,  ''''   ,', 103)'   );
		END if;          
    if (Substring(Campo,1, 1) = '<')  then
      SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' <= convert(datetime,' , '''' ,  Valor ,  '''' ,', 103)') ;
		END IF;            
    if (Substring(Campo,1, 1) = 'M')  then
      SET Condicion = CONCAT(Condicion , 'month(' , Substring(Campo,2, LENGTH(Campo)) , ') = ' , '''' ,  Valor ,  '''' ) ;
      END IF;
    if (Substring(Campo,1, 1) = 'A')  then
      SET Condicion = CONCAT(Condicion , 'year(' , Substring(Campo,2, LENGTH(Campo)) , ') = ' , '''' ,  Valor ,  '''' ) ;
      END IF;
    if (Substring(Campo,1, 1) = 'B')  then
      SET Condicion = CONCAT(Condicion , '' , Substring(Campo,2, LENGTH(Campo)) , ' in (' ,  Valor ,  ')' );
      END IF;
      
#retornamos valor
RETURN Condicion;
END//
DELIMITER ;

-- Volcando estructura para función inicioi_seg.IsNumeric
DELIMITER //
CREATE FUNCTION `IsNumeric`(`sIn` varchar(1024)
) RETURNS tinyint(4)
return sIn REGEXP '^(-|\\+){0,1}([0-9]+\\.[0-9]*|[0-9]*\\.[0-9]+|[0-9]+)$'//
DELIMITER ;

-- Volcando estructura para procedimiento inicioi_seg.pavciudad
DELIMITER //
CREATE PROCEDURE `pavciudad`(
	IN `pCampo0` varchar(150),
	IN `pValor0` varchar(150),
	IN `pCampo1` varchar(150),
	IN `pValor1` varchar(150),
	IN `pCampo2` varchar(150),
	IN `pValor2` varchar(150),
	IN `pCampo3` varchar(150),
	IN `pValor3` varchar(150),
	IN `pCampo4` varchar(150),
	IN `pValor4` varchar(150),
	IN `pCampo5` varchar(150),
	IN `pValor5` varchar(150),
	IN `pCampo6` varchar(150),
	IN `pValor6` varchar(150),
	IN `pCampo7` varchar(150),
	IN `pValor7` varchar(150)
)
BEGIN
DECLARE ps VARCHAR(750);
SET pS = fnDevuelveCondicion(pCampo0,pValor0);

		SET pS = CONCAT(pS , fnDevuelveCondicion(pCampo1,CONCAT('.' , pValor1)));
		SET pS = CONCAT(pS , fnDevuelveCondicion(pCampo2,CONCAT('.' , pValor2)));
		SET pS = CONCAT(pS , fnDevuelveCondicion(pCampo3,CONCAT('.' , pValor3)));
		SET pS = CONCAT(pS , fnDevuelveCondicion(pCampo4,CONCAT('.' , pValor4)));
		SET pS = CONCAT(pS , fnDevuelveCondicion(pCampo5,CONCAT('.' , pValor5)));
		SET pS = CONCAT(pS , fnDevuelveCondicion(pCampo6,CONCAT('.' , pValor6)));
		SET pS = CONCAT(pS , fnDevuelveCondicion(pCampo7,CONCAT('.' , pValor7)));
set pS =CONCAT('SELECT  * from  clciudad' , pS);
PREPARE stmt FROM pS;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END//
DELIMITER ;

-- Volcando estructura para procedimiento inicioi_seg.pcruciudad
DELIMITER //
CREATE PROCEDURE `pcruciudad`(
	IN `pTipo` VARCHAR(50),
	IN `pidciudad` INT,
	IN `pidpais` INT,
	IN `pnombreciudad` VARCHAR(50),
	IN `pabreviacion` CHAR(5),
	IN `porden` INT
)
BEGIN
IF pTipo='C' then 
	SET pidciudad = (SELECT  (IFNULL(MAX(idciudad) + 1,1)) FROM clciudad);
	SELECT pidciudad AS Idciudad;
END if;
IF pTipo='R' then
	SELECT  idciudad, idpais, nombreciudad, abreviacion, orden from  clciudad
   WHERE idciudad=pidciudad AND estadoregistro = 1;
END if;
IF pTipo='U' then 
   UPDATE clciudad set EstadoRegistro = 0 WHERE idciudad=pidciudad AND EstadoRegistro = 1;
	SELECT pidciudad AS Idciudad;
END if;	

END//
DELIMITER ;

